import React from 'react';
import logo from './logo.svg';
import './App.css';
import ProjectPreview from "./ProjectPreview"

function App() {
  return (
    <div className="app">
      <div className="landing-page">
        <header className="app-header">
          <p className="nav-header">Welcome</p>
          <p className="header1">I'm Cathleen. I'm a designer - developer.</p>
          <p className="header1">I create radically different digital experiences to empower others and enable ideas.</p>
        </header>
        <div className="projects">
          <ProjectPreview name="Uber" description="Product design"/>
        </div>
      </div>
      <div className="side-nav">
        <div className="navbar">
          <div className="navbar-01"/>
          <div className="navbar-02"/>
        </div>
        <p className="nav-email">cathleenjia@berkeley.edu</p>
      </div>
    </div>
  );
}

export default App;
